import Navbar from '../components/Navbar'

const Index = () => (
    <React.Fragment>
    <head>
        <link href="https://fonts.googleapis.com/css?family=Roboto" rel="stylesheet"></link>
    </head>
    <body>
    <Navbar />
    </body>
    <style jsx>{`
        * {
          font-family: 'Roboto', sans-serif;
        }
        body{
            margin:0;
            padding:10px, 50px;
        }
      `}</style>
    </React.Fragment>
  )

  export default Index
